INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (0, 1, 1, 1, 40011, 125801, 2, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 24001, 321, "リリ");
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (0, 2, 1, 1, 40011, 126001, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 24001, 322, "クリア");
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (0, 3, 1, 1, 40011, 126101, 2, "んーと。\nこれ、あげる。\nはい", 24001, 323, "プレシア");
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (0, 4, 2, 1, 40011, 125801, 2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 24001, 324, "リリ");
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (0, 5, 2, 1, 40011, 126001, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 325, "クリア");
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (0, 6, 2, 1, 40011, 126101, 2, "お兄。\nきてくれて、うれしい", 24001, 326, "プレシア");
